import React from 'react';
import styled from 'styled-components';

const CustomFooter = styled.footer`
    background: transparent;
    bottom: 0;
    height: -120px;
    display: flex;
    justify-content: space-between;
    align-items: center;

    img {
        height: 40px;
        width: 40px;
        cursor: pointer;
    }
`;

function Footer() {
    return (
        <>
        <CustomFooter>
            <img href="/Home" src={require("../logos/linkedin.png")} />
            <img href="/Home" src={require("../logos/github.png")} /> 
        </CustomFooter>
        </>
    );  
}

export default Footer;
